import React from 'react'
import '../styles/Form.css'
import CardFront from '../images/bg-card-front.png'
import CardBack from '../images/bg-card-back.png'
function Form({ name }) {
    return (
        <div className='flex justify-center flex-col space-y-1 p-5 w-96'>
            <img src={CardFront} />
            <img src={CardBack} />
        </div>
    );
}

export default Form;
